⁣
On Tuesday, November 8, between 3:02 and 6:42 a.m. EST (0802-1350 UTC), a total lunar eclipse will occur, the last total lunar eclipse until March 14, 2025.⁣
⁣
A lunar eclipse occurs when the Sun, Earth, and Moon align, allowing the Moon to pass into Earth\'s shadow. In a total lunar eclipse, the entire Moon falls within the umbra – the darkest part of Earth\'s shadow.⁣
⁣
During a lunar eclipse, light passes through our atmosphere before reaching the lunar surface, allowing colors of longer wavelengths, such as red and orange, to lightly illuminate its surface, while colors like blue and violet scatter across our planet.⁣
⁣
Image description:⁣
⁣
A composite photo shows the Moon in different stages of the eclipse from top left to bottom right. The Moon appears nearly full at the top left in the image before gradually becoming more obscured by Earth\'s shadow from the top left of the Moon. The skyline of Houston, Texas, can be seen in the distance.⁣
⁣
