#Eclipse #Moon #Space #Artemis\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2966537580937971399.jpg?w=200&till=1671778362&sign=0631702ce62a006db1702be38479c9ac\";s:11:\"time_posted\";i:1667858859;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2966537580937971399.jpg?w=200&till=1671778362&sign=0631702ce62a006db1702be38479c9ac\";s:3:\"day\";s:2:\"07\";s:5:\"month\";s:2:\"11\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4778407;s:14:\"comments_count\";i:7557;s:17:\"video_views_count\";i:0;s:2:\"er\";d:5.63;s:7:\"er_mark\";s:9:\"very_good\";}}i:3;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2880798647593354183\";s:4:\"code\";s:11:\"Cf6pxtbOkPH\";s:7:\"caption\";s:1321:\"Oh hey, Webb gave us a ring! 💍\r\rReady for some more stunning first images from the James Webb Space Telescope? Swipe through to see views of the Southern Ring planetary nebula (aka NGC 3132) and its pair of stars, taken by two of Webb’s instruments: NIRCam [1] and MIRI [2].\r \rThese two stars put a new spin on “til death do us part.” The dimmer star, locked in orbit with the younger, brighter star, is dying — expelling gas and dust that Webb sees through in unprecedented detail. In fact, Webb reveals for the first time that the dying star is actually cloaked in dust.\r\rThe stars – and their layers of light – steal more attention in the NIRCam image, while glowing dust plays the lead in the MIRI image. In thousands of years, these delicate, gaseous layers will dissipate into surrounding space. \r \rThe Southern Ring nebula is called a planetary nebula. Despite “planet” in the name, which comes from how these objects first appeared to astronomers observing them hundreds of years ago, these are shells of dust and gas shed by dying Sun-like stars. The new details from Webb will transform our understanding of how stars evolve and influence their environments.\r \rView and download these new images from Webb at the link in our bio: nasa.gov\/webbfirstimages \r \rCredits: NASA, ESA, CSA, and STScI\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2880798647593354183.jpg?w=200&till=1671778362&sign=fb650139db91ff7f20dadad3b09d346e\";s:11:\"time_posted\";i:1657637981;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2880798647593354183.jpg?w=200&till=1671778362&sign=fb650139db91ff7f20dadad3b09d346e\";s:3:\"day\";s:2:\"12\";s:5:\"month\";s:2:\"07\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4662890;s:14:\"comments_count\";i:14837;s:17:\"video_views_count\";i:0;s:2:\"er\";d:5.5;s:7:\"er_mark\";s:9:\"very_good\";}}i:4;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2880803324292519552\";s:4:\"code\";s:11:\"Cf6q1w8OFaA\";s:7:\"caption\";s:1667:\"✋A galactic high five from Webb!⁣
 ⁣
Next up in the James Webb Space Telescope’s first images is Stephan’s Quintet. Here, we see five galaxies, four of which interact. (The left galaxy is actually much closer to us than the rest of the group.) These colliding galaxies are pulling and stretching each other in a gravitational dance. Webb will revolutionize our knowledge of star formation and gas interactions within.⁣
 ⁣
This mosaic is Webb’s largest image to date, covering an area of the sky 1\/5 of the Moon’s diameter (as seen from Earth). It contains more than 150 million pixels and is constructed from about 1,000 image files. Webb is the most complex and powerful space telescope ever built.⁣
 ⁣
View and download Webb’s new image of Stephan’s Quintet at the link in our bio: nasa.gov\/webbfirstimages ⁣

Alt text: ⁣A group of five galaxies that appear close to each other in the sky: two in the middle, one toward the top, one to the upper left, and one toward the bottom. Four of the five appear to be touching. One is somewhat separated. In the image, the galaxies are large relative to the hundreds of much smaller (more distant) galaxies in the background. All five galaxies have bright white cores. Each has a slightly different size, shape, structure, and coloring. Scattered across the image, in front of the galaxies are number of foreground stars with diffraction spikes: bright white points, each with eight bright lines radiating out from the center.⁣
 ⁣
Credits: NASA, ESA, CSA, and STScI⁣
 ⁣
